function submitBlankPage(g,d){var f=Confluence.getContextPath()+"/pages/createpage.action?spaceKey="+encodeURIComponent(d.spaceKey);var c=Confluence.Blueprint.Util.getParentPageLocation().parentPageId,a=$("#page-restricted-container").length||$(".request-access-container").length;if(!a&&c&&d.spaceKey==AJS.Meta.get("space-key")&&AJS.Meta.get("content-type")=="page"){f+="&fromPageId="+encodeURIComponent(c)}if(d.initContext){for(var b in d.initContext){f+="&"+encodeURIComponent(b)+"="+encodeURIComponent(d.initContext[b])}}d.finalUrl=f}Confluence.Blueprint.setDirectCallback("com.atlassian.confluence.plugins.confluence-create-content-plugin:create-blank-page",submitBlankPage);